import React from 'react';

const Slider = ({key, que}) => {
	const data = JSON.parse(sessionStorage.getItem(que));
	const max = data.max;
	const step = data.step;
	
	return (
		<div key={`${que}_${key}`}>
			<div>{que}</div>
			<input type="range" min={0} max={max} step={step} value={max/2} />
		</div>
	);
};

export default Slider;
